import React from "react";
import { Router } from "@reach/router";

import Login from "./Login";
import SignUp from "./SignUp";
import UserProfile from "./UserProfile";

function AppRouter() {
  const user = null;
  return (
        user ?
        <UserProfile />
      :
        <Router>
          <SignUp path="/signup" />
          <Login path="/login" />
        </Router>

  );
}
export default AppRouter;
